import React from "react";
import { CarouselWrapper } from "react-pretty-carousel";
import { makeStyles } from '@material-ui/core/styles';
import { Typography } from "@material-ui/core";

const useStyles = makeStyles(() => ({
    root: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    header: {
        color: 'white',
        fontSize: '40px'
    },
    img: {
        height: '400px',
        width: '900px'
    },
}));

const ImageWrapper = (props) => {
    const classes = useStyles()

    if( !document.queryselector('.products-slider-wrapper-item') ) {return (
    <div className={`${classes.root} ${props.className}`}>
        <Typography className={classes.header}>Фото с уроков</Typography>
      <CarouselWrapper items={1} mode="normal">
          {props.imgItems.map( (img, index) => {
               return <img alt='img' className={classes.img} src={img} key={index}/>
          })}
      </CarouselWrapper>
    </div>
  )};
}

export default ImageWrapper
